// src/pages/PageAcceuil.jsx
// Position:  \src\Pages\PageAcceuil.jsx
import React from 'react';
import Boutton from '../components/Boutton';
import Footer from '../components/Footer';

function PageAcceuil() {
  return (
    <div>

      {/* 1. Logo au centre de la page */}
      <div style={{ textAlign: 'center' }}>
        <img src="/logo.png" alt="Logo" />
      </div>

      {/* 2. Input "Votre login" */}
      <div>
        <label htmlFor="loginInput">Votre login</label>
        <div>
          <img src="/Users.png" alt="Users Icon" />
          <input type="text" id="loginInput" style={{ backgroundColor: 'gray' }} />
        </div>
      </div>

      {/* 3. Input "Votre mot de passe" */}
      <div>
        <label htmlFor="passwordInput">Votre mot de passe</label>
        <div>
          <img src="/Cadenas.png" alt="Cadenas Icon" />
          <input type="password" id="passwordInput" style={{ backgroundColor: 'gray' }} />
        </div>
      </div>

      {/* 4. Input "Se rappeler de moi" */}
      <div>
        <input type="checkbox" id="rememberMeInput" style={{ backgroundColor: 'gray' }} />
        <label htmlFor="rememberMeInput">Se rappeler de moi</label>
      </div>

      {/* 5. Boutton "Connection" */}
      <Boutton texte="Connection" />

      {/* 6. Footer */}
      <Footer />
    </div>
  );
}

export default PageAcceuil;
